interface Iproduct{
    sno:string;
    name:string;
    image:string;
    price:number;
    qty:number;
}

interface IProps {}

interface IState {
   product:Iproduct
}

class ProductItems extends React.Component<IProps, IState>{

    constructor(props:IProps) {
        super(props);
         this.state={
            product:{
                sno:'AA101',
                name:'Mi Watch',
                image:'',
                price:1500,
                qty:2,
            }
        }
    }

    render() {
        return (
            <React.Fragment>
               <h1>Product Items</h1>
            </React.Fragment>
        );
    }
}
export default ProductItems;
